import React, {useState} from 'react';
import styled, { ThemeProvider } from 'styled-components';
import { GlobalStyles } from '../../GlobalStyle/global';
import { theme } from '../../GlobalStyle/theme';
import BurgerMenu from './BurgerMenu';

const Main = () => {
    return (
        <ThemeProvider theme={theme}>
        <>
            <GlobalStyles />
            <div>
                <BurgerMenu/>
                <div>
                  <StyledH1>Nome</StyledH1>
                  <StyledP>Encontre monitores dentro da sua faculdade!</StyledP>
                  <ImageDiv>
                    <img src="https://play.google.com/intl/pt-BR/badges/static/images/badges/pt-br_badge_web_generic.png" 
                          alt="googlePlay"
                          width="150px"
                          position="absolute"></img>
                    <img src="https://developer.apple.com/app-store/marketing/guidelines/images/badge-download-on-the-app-store.svg" 
                          alt="appStore"
                          position="absolute"></img>
                  </ImageDiv>
                </div>
            </div>
        </>
        </ThemeProvider>
    );
}

const StyledH1 = styled.h1`
  position: relative;
  @media only screen and (min-width: 600px) {
    font-size: 3vw;
    margin-bottom: 20px;
    margin-left: 10px;
  }

  @media only screen and (max-width: 600px) {
    font-size: 4vw;
    margin-bottom: 20px;
    margin-left: 10px;
  }

  @media only screen and (min-width: 1400px) {
    font-size: 2vw;
    margin-bottom: 20px;
    margin-left: 10px;
  }
`;

const StyledP = styled.p`
  position: relative;
  @media screen and (min-width: 601px) {
    font-size: 2vw;
    margin-bottom: 200px;
    margin-right: 40vw;
  }

  @media screen and (max-width: 600px) {
    font-size: 2vw;
    margin-bottom: 50px;
    margin-right: 40vw;
  }

  @media only screen and (min-width: 1400px) {
    font-size: 2vw;
    margin-bottom: 250px;
    margin-right: 750px;
  }
`;

const ImageDiv = styled.div`
  display: inline;
`;

export default Main;
